<?php
$url = $_GET['url'];
header("Content-Type: text/html; charset=ISO-8859-1");
if (isset($_GET['post']) AND $_GET['post'] == true){
	$postdata = http_build_query(
		array(
			//'__EVENTARGUMENT' => null,
			//'__EVENTTARGET' => null,
			'__EVENTVALIDATION' => "",
			'__VIEWSTATE' => "",
			'ucNavigationBarSimple:btn'.$_GET['page'] => $_GET['page'],
			'ucTop:txtSearch' => null,		
			)
		);
	
	$opts = array('http' =>
		array(
			'method'  => 'POST',
			'header'  => 'Content-type: application/x-www-form-urlencoded',
			'content' => $postdata,
			)
		);

	$context  = stream_context_create($opts);

	echo str_replace("src=", "temp=", file_get_contents($url, false, $context));

	}
else{
	echo str_replace("src=", "temp=", file_get_contents($url));
	}
?>